import React from "react";
import YoutubeEmbed from "./YoutubeEmbed";

const Youtube = () => {
  return (
    <div className="youtube">
      <h1>Youtube Embed</h1>
      <YoutubeEmbed embedId="rokGy0huYEA" />
    </div>
  );
};

export default Youtube;
